<?phpnamespace Nemundo\WebLog\Data\UrlLog;class UrlLog extends \Nemundo\Model\Data\AbstractModelData {/*** @var UrlLogModel*/protected $model;/*** @var string*/public $url;/*** @var int*/public $visitor;/*** @var string*/public $pageTitle;public function __construct() {parent::__construct();$this->model = new UrlLogModel();}public function save() {$this->typeValueList->setModelValue($this->model->url, $this->url);$this->typeValueList->setModelValue($this->model->visitor, $this->visitor);$this->typeValueList->setModelValue($this->model->pageTitle, $this->pageTitle);$id = parent::save();return $id;}}